import React from "react";

export default function ImageStore() {
  return (
    <div className="container">
      <h2>Upload Image</h2>
      <form action="/action_page.php">
        <input type="file" id="myFile" name="filename" />
        <input type="submit" />
      </form>
    </div>
  );
}
